import React, { Component, useEffect, useState } from "react";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faHome , faBaby , faCheckCircle, faFileAlt , faPlusSquare, faUserMd, faCalendar, faCalendarAlt, faAd, faUserCog, faChevronDown, faCaretDown, faUserAlt, faMapMarker, faCog, faSignOutAlt } from '@fortawesome/free-solid-svg-icons';
import Logo from "../logo1.jpg";
import Profile from "./images/profile.png";
import { Link  } from "react-router-dom";
import classnames from "classnames";
import $ from 'jquery';
import '../components/Navbar.css';
import Slider1 from '../images/slider5.jpg';
import Slider2 from './images/slider6.jpg';
import Slider3 from './images/slider13.jpg';
import Slider4 from './images/slider12.jpg';

import { NavLink } from 'react-router-dom';
export default class Navbar extends Component {
  constructor (props) {
    super(props);

    this.state={
      prevScrollpos:window.pageYOffset,
      VISIBLE: true
    };
  }

  componentDidMount(){
    window.addEventListener("scroll", this.handleScroll);
  }

  componentWillUnmount() {
    window.removeEventListener("scroll", this.handleScroll);
  }

  handleScroll = () => {
    const { prevScrollpos } = this.state;

    const currentScrollPos = window.pageYOffset;
    const visible = prevScrollpos > currentScrollPos;

    this.setState({
      prevScrollpos: currentScrollPos,
      visible
    });
  };

  render(){
    return (

<div>
<nav className={classnames("navbar navbar-expand-lg navbar-light fixed-top w-100", {"navbar--hidden": !this.state.visible})}>
  <div className="container-fluid">

    <img src={Logo} alt="logo" width="50" height="50"/>
    {/* <Link to="/" className="navbar-brand">Pregnancy Tracker</Link> */}
    <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
      <span className="navbar-toggler-icon"></span>
    </button>


    <div className="collapse navbar-collapse" id="navbarSupportedContent">
      <ul className="navbar-nav mx-auto mb-2 mb-lg-0">
        <li className="nav-item">
            <Link to="/home" className="nav-link active">
            <FontAwesomeIcon icon = {faHome}/> &nbsp;  
              Home
            </Link>
        </li> &nbsp;   &nbsp;   &nbsp;  

        <li className="nav-item dropdown">
        <Link to="/cute'sdevelopment" className="nav-link dropdown-toggle nav-link active" id="navbarDropdown" role="button" data-bs-toggle="dropdown" aria-expanded="false">
          <FontAwesomeIcon icon = {faBaby}/> &nbsp;
            Cute's Development
          </Link>
          <ul className="dropdown-menu bg-light" aria-labelledby="navbarDropdown">
            <li><a className="dropdown-item text-black" href="/pregnancybyweek">Pregnancy by week</a></li>
            <li><a className="dropdown-item text-black" href="/inthewomb">In the womb</a></li>
            <li><hr className="dropdown-divider text-black"/></li>
            <li><a className="dropdown-item text-black" href="/kickcounter">Kick Counter</a></li>
            <li><a className="dropdown-item text-black" href="/contractiontimer">Contraction Timer</a></li>
            <li><a className="dropdown-item text-black" href="/growthtracker">Growth Tracker</a></li>
          </ul>
        </li> &nbsp;   &nbsp;   &nbsp;  

        <li className="nav-item dropdown">
        <Link to="/planning" className="nav-link dropdown-toggle nav-link active" id="navbarDropdown" role="button" data-bs-toggle="dropdown" aria-expanded="false">
          <FontAwesomeIcon icon = {faCheckCircle}/>&nbsp;  
            Planning
          </Link>
          <ul className="dropdown-menu bg-light" aria-labelledby="navbarDropdown">
            <li><a className="dropdown-item text-black" href="/hospitalbagchecklist">Hospital bag checklist</a></li>
            <li><a className="dropdown-item text-black" href="/mybabyname">My baby name</a></li>
          </ul>
        </li> &nbsp;&nbsp;&nbsp;

        <li className="nav-item dropdown">
        <Link to="/education&support" className="nav-link dropdown-toggle nav-link active" id="navbarDropdown" role="button" data-bs-toggle="dropdown" aria-expanded="false">
          <FontAwesomeIcon icon = {faFileAlt}/>&nbsp; 
            Education & Support
          </Link>
          <ul className="dropdown-menu bg-light" aria-labelledby="navbarDropdown">
            <li><a className="dropdown-item text-black" href="/dailyselfcarechecklist">Daily self-care checklist</a></li>
            <li><a className="dropdown-item text-black" href="/articles&videos">Articles & Videos</a></li>
            <li><a className="dropdown-item text-black" href="/insights">Insights</a></li>
          </ul>
        </li>&nbsp;&nbsp;&nbsp; 

        <li className="nav-item dropdown">
        <Link to="/product&safety" className="nav-link dropdown-toggle nav-link active" id="navbarDropdown" role="button" data-bs-toggle="dropdown" aria-expanded="false">
          <FontAwesomeIcon icon = {faAd}/>&nbsp;
            Product & Safety
          </Link>
          <ul className="dropdown-menu bg-light" aria-labelledby="navbarDropdown">
            <li><a className="dropdown-item text-black" href="/babyproducts">Baby products</a></li>
            <li><a className="dropdown-item text-black" href="/doctorchanneling">Doctor channeling</a></li>
          </ul>
        </li>&nbsp;&nbsp;&nbsp; 

        <li className="nav-item">
        <Link to="/calendar" className="nav-link active">
          <FontAwesomeIcon icon = {faCalendarAlt}/>&nbsp;
              Calendar
        </Link>
        </li> &nbsp;&nbsp;&nbsp; 

        <li className="nav-item">
        <Link to="/health&medical" className="nav-link active">
          <FontAwesomeIcon icon = {faUserMd}/>&nbsp;
              Health & Medical
        </Link>
        </li> &nbsp;&nbsp;&nbsp; 

        {/* <Link to="/signup" class="btn btn-success">Sign Up</Link> */}

      </ul>

      <form className="d-flex">
        <input className="form-control me-2" type="search" placeholder="Search" aria-label="Search" />
        <button className="btn btn-outline-success" type="submit">Search</button>
      </form>

      <ul className="navbar-nav mx-auto mb-2 mb-lg-0">
      <li className="nav-item dropdown">
        <Link to="/" className="profilenav dropdown-toggle profilenav active" id="navbarDropdown" role="button" data-bs-toggle="dropdown" aria-expanded="false">
        <img src={Profile} alt="logo" width="30" height="30"/>&nbsp;
            Mahesha
          </Link>
          <ul className="dropdown-menu bg-light" aria-labelledby="navbarDropdown">
            <li><a className="dropdown-item text-black" href="/myaccount">
            <FontAwesomeIcon icon = {faUserAlt}/>&nbsp;
              My account</a></li>
            <li><a className="dropdown-item text-black" href="/settings">
            <FontAwesomeIcon icon = {faCog}/>&nbsp;
              Settings</a></li>
              <li><a className="dropdown-item text-black" href="/logout">
            <FontAwesomeIcon icon = {faSignOutAlt}/>&nbsp;
              Logout</a></li>
          </ul>
        </li>
       </ul>
    </div>
  </div>
</nav>

<div id="carouselExampleCaptions" className="my-carousel carousel slide" data-bs-ride="carousel">
        <div className="carousel-indicators">
          <button type="button" data-bs-target="#carouselExampleCaptions" data-bs-slide-to="0" className="active" aria-current="true" aria-label="Slide 1"></button>
          <button type="button" data-bs-target="#carouselExampleCaptions" data-bs-slide-to="1" aria-label="Slide 2"></button>
          <button type="button" data-bs-target="#carouselExampleCaptions" data-bs-slide-to="2" aria-label="Slide 3"></button>
          <button type="button" data-bs-target="#carouselExampleCaptions" data-bs-slide-to="3" aria-label="Slide 4"></button>
        </div>
        <div className="carousel-inner">
          <div className="carousel-item active">
            <img src={Slider1} className="d-block w-100" alt="..."/>
            <div className="carousel-caption d-none d-md-block">
              <h5>Pregnancy Week By Week</h5>
              <p>Get Updates on baby's development, decode your pregnancy Symptoms and see your weekly to-dos.</p>
              <div className="slider-btn">
                  <button className="btn btn-1">Read More</button>
              </div>
            </div>
          </div>
          <div className="carousel-item">
            <img src={Slider2} className="d-block w-100" alt="..."/>
            <div className="carousel-caption d-none d-md-block">
              <h5>Find The Perfect Baby Name</h5>
              <p>Whether you are looking for a baby girl name, or a baby boy name, or both, we help you to explore baby names.</p>
              <div className="slider-btn">
                  <button className="btn btn-1">Read More</button>
              </div>
            </div>
          </div>
          <div className="carousel-item">
            <img src={Slider3} className="d-block w-100" alt="..."/>
            <div className="carousel-caption d-none d-md-block">
              <h5>Channel the Doctor</h5>
              <p>We are providing best and affordable health care for your baby.</p>
              <div className="slider-btn">
                  <button className="btn btn-1">Make Appointment</button>
              </div>
            </div>
          </div>
          <div className="carousel-item">
            <img src={Slider4} className="d-block w-100" alt="..."/>
            <div className="carousel-caption d-none d-md-block">
              <h5>Explore Our Baby Products</h5>
              <p>Preparing for a Newborn Hospital Bag.</p>
              <div className="slider-btn">
                  <button className="btn btn-1">Shop Now</button>
              </div>
            </div>
          </div>

        </div>
        <button className="carousel-control-prev" type="button" data-bs-target="#carouselExampleCaptions" data-bs-slide="prev">
          <span className="carousel-control-prev-icon" aria-hidden="true"></span>
          <span className="visually-hidden">Previous</span>
        </button>
        <button className="carousel-control-next" type="button" data-bs-target="#carouselExampleCaptions" data-bs-slide="next">
          <span className="carousel-control-next-icon" aria-hidden="true"></span>
          <span className="visually-hidden">Next</span>
        </button>
      </div>



</div>


    );
}
}


// export default Navbar;
